import ProgressBar from 'react-bootstrap/ProgressBar';
import {Fragment, useState} from 'react'

function BasicExample() {

    let [now, setNow] = useState(0)

    const start = () => {
        while (now !== 100) {
            setNow((now++))
        }

    }

    return (
        <Fragment>
            <ProgressBar now={now} />
            <button
                className={"m-5"}
                onClick={start}
            >
                start!
            </button>
        </Fragment>

    );
}

export default BasicExample;
